window.bookSummaryJSON = "<p><b>Unlock magical powers. Wrangle monster girls. Rule the wilderness.</b></p> <p>Braddock is now the Meadow Master.</p> <p>His people are building a town in the wilderness, his women are pregnant, and he has a powerful ally in the smuggler merchant, Red Eyes.</p> <p>Things are going well. But life on Tardoon is never easy.</p> <p>Now, Braddock must rescue Cascadia from the river hag, explore the dangerous city of Black Harbor, petition a powerful sorceress, and free a mysterious woman imprisoned in gemstone.</p> <p>Meanwhile, huge predators menace his people, marauding centaurs hunt Elizabeth, and the wicked sprite queen, Hortensia, plans to kill everyone Braddock loves.</p> <p>Can an Earthman running low on ammo wrangle a world of monsters and magic?</p> <p><b>Warning: This series contains adult themes, graphic violence, and a strong male protagonist with the rough and ready attitude of an American frontiersman. Listen at your own risk.</b></p>"; 
